import "./Form.module.css"
import React from 'react'

const Form2 = () => {
  return (
    <div className="container">
        <form>
             <h1>Acesse o sistema:</h1>
             <input type="text" placeholder= "Matricula"/>
             <input type="password" placeholder= "Senha"/>
        </form>
      
    </div>
  )
}

export default Form2;
